	START_SHAPE_TEST_BOUND=function(entity--[[@param entity integer]],flags1--[[@param flags1 integer]],flags2--[[@param flags2 integer]])return InvokeInt(0x37181417CE7C8900,entity,flags1,flags2)end;---@return integer
	--[=[Raycast from point to point, where the ray has a radius. 

flags:
vehicles=10
peds =12

