	START_SHAPE_TEST_SWEPT_SPHERE=function(x1--[[@param x1 number]],y1--[[@param y1 number]],z1--[[@param z1 number]],x2--[[@param x2 number]],y2--[[@param y2 number]],z2--[[@param z2 number]],radius--[[@param radius number]],flags--[[@param flags integer]],entity--[[@param entity integer]],p9--[[@param p9 any]])return InvokeInt(0xE6AC6C45FBE83004,x1+.0,y1+.0,z1+.0,x2+.0,y2+.0,z2+.0,radius+.0,flags,entity,p9)end;---@return integer
