	GET_SHAPE_TEST_RESULT=function(shapeTestHandle--[[@param shapeTestHandle integer]],hit--[[@param hit boolean*]],endCoords--[[@param endCoords V3*]],surfaceNormal--[[@param surfaceNormal V3*]],entityHit--[[@param entityHit integer*]])return InvokeInt(0x3D87450E15D98694,shapeTestHandle,hit,endCoords,surfaceNormal,entityHit)end;---@return integer
